import whitelogo from '../images/tinderwhitelogo.png'
import colorLogo from '../images/tinderlogo.png'

const Nav = ({minimal, authToken, setShowModal, showModal}) => {

    const handleClick = () => {
        setShowModal(true)
    }

    return (
        <nav> 
            <div className="logo-container">
                <img className="logo" src={minimal ? colorLogo : whitelogo}/>
            </div>

            {!authToken && !minimal && <button 
                className="nav-button"
                onClick={handleClick}
                disabled={showModal}
            >Log in</button>}
        </nav>
    )
}
export default Nav
